import React, { ReactNode } from 'react'
import Link from 'next/link'

const Content = (content = []) => content.map(paragraph => <p>{paragraph}</p>)

const Doc = ({author, date, title, content, description}) => (
  <div className="doc">
    <div className="doc__metadata">
      <h1>{title}</h1>
      <h3>{description}</h3>
      {author ? <p>{author}</p> : null}
      {date ? <p>{date}</p> : null}
    </div>
    <hr />
    <div className="doc__content">
      <p>
        {Content(content)}
      </p>
    </div>
  </div>
)

export default Doc
